package com.models;import lombok.Builder;import lombok.Data;@Data@Builderpublic class ShipInfo {        private String firstName;    private String lastName;    private String zip;        public String getFirstName( ){        return firstName;    }        public String getLastName( ){        return lastName;    }        public void setLastName( String lastName ){        this.lastName = lastName;    }        public void setFirstNameName( String lastName ){        this.lastName = lastName;    }        public String getZip( ){        return zip;    }        public void setZip( String zip ){        this.zip = zip;    }}